// SPDX-License-Identifier: GPL-3.0-or-later

pragma solidity ^0.7.0;
pragma experimental ABIEncoderV2;

import "./Ownable.sol";
import "../interfaces/IBEP20.sol";

contract MultipleVesting is Ownable {

     event NewVestingContract(address indexed beneficiary, uint256 start, uint256 cliff, 
                    uint256 duration, uint256 vesting, uint256 unlocked);

    struct Vesting {
        address beneficiary;
        uint256 start;
        uint256 cliff;
        uint256 duration;
        uint256 amount;
        uint256 unlocked;
    }

    address public pool;
    IBEP20 public token;
    bytes4 transferOwnershipSignature = bytes4(keccak256(bytes("transferOwnership(address)")));
    bytes4 addBeneficiarySignature = bytes4(keccak256(bytes("addBeneficiary(address,uint256,uint256,uint256,uint256)")));
    bytes4 claimOwnershipSignature = bytes4(keccak256(bytes("claimOwnership()")));

    constructor(address _pool, address _token) {
        pool = _pool;
        token = IBEP20(_token);
    }

    function changeOwnershipOfPool() external onlyOwner {
        (bool success, bytes memory _) = pool.call(abi.encodeWithSelector(transferOwnershipSignature, owner));
        // equivalent to abi.encodeWithSignature("transferOwnership(address)", owner);
        require(success, "Error in changing ownership");
    }

    function claimOwnershipOfPool() external onlyOwner {
        (bool success, bytes memory _) = pool.call(abi.encodeWithSelector(claimOwnershipSignature));
        require(success, "Error in claiming ownership");
    }

    function createMultipleVestings(Vesting[] calldata vestings) external onlyOwner{
        for (uint i = 0; i < vestings.length; i++) {
            Vesting calldata current = vestings[i];
            if (current.unlocked > 0) {
                token.transfer(current.beneficiary, current.unlocked);
            }
            if (current.amount > 0) {
                (bool success, bytes memory _) = pool.call(abi.encodeWithSelector(addBeneficiarySignature, 
                            current.beneficiary, current.start, current.cliff, current.duration, current.amount));
                require(success, "Error in adding beneficiary");
            }

            emit NewVestingContract(current.beneficiary, current.start, 
                       current.cliff, current.duration, current.amount, current.unlocked);
        }
    }

    function withdrawTokens() external onlyOwner {
        uint256 balance = token.balanceOf(address(this));
        if (balance > 0) {
            token.transfer(owner, balance);
        }
    }

    function setPoolAddress(address _newpool) external onlyOwner {
        require(_newpool != address(0));
        pool = _newpool;
    }

    function setTokenAddress(IBEP20 _token) external onlyOwner {
        require(address(_token) != address(0));
        token = IBEP20(_token);
    }
}
